import React, { Children } from "react";
import style from "./layout.module.css"

export default function Layout({ children }) {
  return (
    <div
      style={{
        maxWidth: "36rem",
        padding: "0 1rem",
        margin: "3rem auto 6rem",
      }}
    >
      {children}
    </div>
  );
}
